import NavbarOption from "../NavbarOption/NavbarOption";

const NavbarInfo = {
    link: "link4.html",
    name: "Enlace 4"
}

export default function Navbar() {
    return (
        <ul>
            <NavbarOption link={"link1.html"} name={"Enlace 1"}/>
            <NavbarOption link={"link2.html"} name={"Enlace 2"}/>
            <NavbarOption link={"link3.html"} name={"Enlace 3"}/>
            /*Tambi√©n se puede con un objeto usando el spread operator (...)*/
            <NavbarOption {...NavbarInfo}/>
        </ul>
    );
}
